import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import BeansService from "../services/beans-service";
import "../css/postProduct.css";

const PostProductComponent = ({ currentUser, setCurrentUser }) => {
  let [title, setTitle] = useState("");
  let [weight, setWeight] = useState("");
  let [cultivar, setCultivar] = useState("");
  let [processing, setProcessing] = useState("");
  let [roast, setRoast] = useState("");
  let [description, setDescription] = useState("");
  let [price, setPrice] = useState(0);
  let [message, setMessage] = useState("");
  const navigate = useNavigate();

  const handleChangeTitle = (e) => {
    setTitle(e.target.value);
  };
  const handleChangeWeight = (e) => {
    setWeight(e.target.value);
  };
  const handleChangeCultivar = (e) => {
    setCultivar(e.target.value);
  };
  const handleChangeProcessing = (e) => {
    setProcessing(e.target.value);
  };
  const handleChangeRoast = (e) => {
    setRoast(e.target.value);
  };
  const handleChangeDescription = (e) => {
    setDescription(e.target.value);
  };
  const handleChangePrice = (e) => {
    setPrice(e.target.value);
  };
  const postProduct = () => {
    console.log(currentUser);
    BeansService.post(
      title,
      weight,
      cultivar,
      processing,
      roast,
      description,
      price
    )
      .then(() => {
        window.alert("新商品已創建成功");
        console.log(currentUser);
        navigate("/product");
      })
      .catch((error) => {
        console.log(error.response);
        setMessage(error.response.data);
      });
  };

  return (
    <div className="post-product-container">
      {currentUser && currentUser.user.role !== "store" ? (
        <div className="unauthorized-message">
          <i className="fas fa-lock"></i>
          <p>只有店家可以發布新商品。</p>
        </div>
      ) : (
        currentUser &&
        currentUser.user.role === "store" && (
          <>
            <h2 className="post-product-title">新增商品</h2>
            <div className="form-group">
              <label className="form-label">商品名稱</label>
              <input
                name="title"
                type="text"
                className="form-control"
                onChange={handleChangeTitle}
                placeholder="請輸入商品名稱"
              />
            </div>

            <div className="form-group">
              <label className="form-label">重量 (g)</label>
              <input
                name="weight"
                type="number"
                className="form-control"
                onChange={handleChangeWeight}
                placeholder="請輸入商品重量"
              />
            </div>

            <div className="form-group">
              <label className="form-label">品種</label>
              <input
                name="cultivar"
                type="text"
                className="form-control"
                onChange={handleChangeCultivar}
                placeholder="請輸入咖啡品種"
              />
            </div>

            <div className="form-group">
              <label className="form-label">處理法</label>
              <input
                name="processing"
                type="text"
                className="form-control"
                onChange={handleChangeProcessing}
                placeholder="請輸入處理方式"
              />
            </div>

            <div className="form-group">
              <label className="form-label">烘焙程度</label>
              <input
                name="roast"
                type="text"
                className="form-control"
                onChange={handleChangeRoast}
                placeholder="請輸入烘焙程度"
              />
            </div>

            <div className="form-group">
              <label className="form-label">產品內容</label>
              <textarea
                name="description"
                className="form-control"
                onChange={handleChangeDescription}
                placeholder="請輸入產品詳細描述"
              />
            </div>

            <div className="form-group">
              <label className="form-label">價格</label>
              <input
                name="price"
                type="number"
                className="form-control"
                onChange={handleChangePrice}
                placeholder="請輸入商品價格"
              />
            </div>

            <button className="submit-btn" onClick={postProduct}>
              發布商品
            </button>

            {message && (
              <div className="alert alert-warning" role="alert">
                {message}
              </div>
            )}
          </>
        )
      )}
    </div>
  );
};

export default PostProductComponent;
